import { Card } from "antd";
import alerts from "./Data/alert.json";

// var counter = alerts.reduce(function (prev, cur) {
//   if (prev.hasOwnProperty(cur.type)) prev[cur.type] += 1;
//   else prev[cur.type] = 1;

//   return prev;
// }, {});

const groupByThreatCategory = alerts.reduce((thisData, dev) => {
  thisData[dev.threat_category] = thisData[dev.threat_category] + 1 || 1;
  return thisData;
}, {});

console.log(JSON.stringify(groupByThreatCategory));

function EmergingThreatsCard() {
  return (
    <div>
      <Card
        headStyle={{
          color: "white",
          background: "#3E3D40",
        }}
        title="Emerging Threats"
        style={{
          width: "100%",
          overflow: "hidden",
          color: "white",
          margin: "0 auto",
        }}
        bodyStyle={{ background: "#1F1E26" }}
      >
        <div>
          {alerts
            .map((threats) => threats.threat_category)
            .reduce((thisData, dev) => {
              thisData[dev.threat_category] =
                thisData[dev.threat_category] + 1 || 1;
            })}
        </div>
      </Card>
    </div>
  );
}

export default EmergingThreatsCard;
